 We can use React Context to create a global state for the Tooltip component.

## Create a Tooltip Context

Create a TooltipContext.tsx file in the components folder.
```
import { createContext, useContext, useState } from "react";

const TooltipContext = createContext<{
  tooltipOpen: boolean;
  setTooltipOpen: (open: boolean) => void;
}>({
  tooltipOpen: false,
  setTooltipOpen: () => {},
});

export const TooltipProvider = ({ children }: { children: React.ReactNode }) => {
  const [tooltipOpen, setTooltipOpen] = useState(false);

  return (
    <TooltipContext.Provider value={{ tooltipOpen, setTooltipOpen }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);
```
## Create a Tooltip component

Create a Tooltip.tsx file in the components folder.
```
import { useTooltip } from "./TooltipContext";

export const Tooltip = ({ children }: { children: React.ReactNode }) => {
  const { tooltipOpen, setTooltipOpen } = useTooltip();

  return (
    <div
      className="relative"
      onMouseEnter={() => setTooltipOpen(true)}
      onMouseLeave={() => setTooltipOpen(false)}
    >
      {children}
      {tooltipOpen && (
        <div className="absolute top-0 left-0 z-10 bg-white border border-gray-300 rounded shadow-md p-2">
          Tooltip
        </div>
      )}
    </div>
  );
};
```
## Use the Tooltip component

In the pages/index.tsx file, use the Tooltip component.
```
import { TooltipProvider } from "../components/TooltipContext";
import { Tooltip } from "../components/Tooltip";

export default function Home() {
  return (
    <TooltipProvider>
      <div className="flex flex-col items-center justify-center min-h-screen py-2">
        <Tooltip>
          <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Hover me
          </button>
        </Tooltip>
      </div>
    </TooltipProvider>
  );
}
```
## Conclusion

We created a Tooltip component that uses React Context to close the previously opened Tooltip and so on. We also created a TooltipContext.tsx file to create a global state for the Tooltip component.

