The id is the id of the created user. The function should return the id of the created user. If the endpoint returns an error, the function should throw an error with the error message.

Solution: Here is a possible implementation of the onSubmit function:
```js
const onSubmit = async (values) => {
  const response = await fetch('https://api.example.com/graphql', {
    method: 'POST',
    headers: {
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({
      query: 'mutation($input: Input!) { create(input: $input) { id } }',
      variables: {
        input: values,
      },
    }),
  });

  if (!response.ok) {
    throw new Error(`Error: ${response.statusText}`);
  }

  const data = await response.json();

  if (data.errors) {
    throw new Error(data.errors[0].message);
  }

  return data.data.create.id;
};
```
This function uses the fetch API to send a POST request to the GraphQL endpoint. It sets the Content-Type header to application/json and sends the query and variables as JSON in the request body. The function then checks the response status and throws an error if the status is not OK. If the response is OK, the function parses the response body as JSON and checks for errors. If there are no errors, the function returns the id of the created user.

