I'm trying to understand the use case for cloneElement. I've read the documentation and I've seen examples of cloneElement in action, but I don't understand why I would use cloneElement instead of passing properties directly to a component.
For example, I could use cloneElement to pass properties to a child component:
const Parent = ({ children }) => {
  const childWithProps = React.cloneElement(children, { name: 'Tom' });
  return <div>{childWithProps}</div>;
const Child = ({ name }) => <div>{name}</div>;
const App = () => (
  <Parent>
    <Child />
  </Parent>
But I could also just pass the properties directly to the child component:
const Parent = ({ children }) => <div>{children}</div>;
const Child = ({ name }) => <div>{name}</div>;
const App = () => (
  <Parent>
    <Child name="Tom" />
  </Parent>
What is the difference between these two approaches? When should I use cloneElement instead of passing properties directly to a component?
